                                    //       name="formHorizontalRadios"
                                    //       id="formHorizontalRadios3"
                                    //     />
                                    //    </Form.Group> 

                                    //   </Form >

                              );
                            })
                          }
                        </ul>
                        </Row>
                    </Col>
                    );
                  })
                } 

        <Link to="/RecProgram">
                <Button className="Edu-done-button" style={{ fontSize:'1vw'}}>
                  Done
                </Button>
                </Link>

          </Col>
            </ul>






             </div>
             </Col>
            </Container>
          </div>
          </>
      )
  }
}

export default EduInformation;
